import server from '../api/server'
import history from '../history'

import {
    SIGN_IN, 
    SIGN_OUT, 
    CREATE_STREAM,
    FETCH_STREAMS,
    FETCH_STREAM,
    DELETE_STREAM,
    EDIT_STREAM,
    SUC_SNACK,
    SIGN_UP,
    PSIGN_IN,CHK_TKN, PSIGN_OUT
} from './types'

export const signIn = (userId) =>{
    return{
        type: SIGN_IN,
        payload:userId
    }
}

export const signOut = () =>{
    return{
        type: SIGN_OUT
    }
}
export const signUp=(formValues,gender)=>{
    const{name, username,email,password}=formValues
    return async(dispatch)=>{
        try{
            const response = await server.post('/register',{name, username,email,password,gender})
            dispatch({type: SIGN_UP, payload:response.data.userId})
            history.push('/login')
        }
        catch(e){
            alert(e.response.data.error)
        }

    }
}

export const psignIn = (formValues)=>{
    const{username, password}=formValues
    return async(dispatch)=>{
        try{
            const res = await fetch('https://streamshow-backend.herokuapp.com/login',{
                method:"POST",
                headers:{
                    "Content-Type":"application/json"
                },
                body: JSON.stringify({
                    username,
                    password
                })
            })
            if(res.status !== 400){
                const data= await res.json()
                dispatch({type:PSIGN_IN, payload:data._id})
                history.push('/home')
            }
            else{
                const error = new Error("Invalid Credentials")
                throw error
            }
        }
        catch(e){
            alert(e)
        }
    }
}

export const psignOut = ()=>{
    return async(dispatch)=>{
        try{
            const res = await fetch('https://streamshow-backend.herokuapp.com/logout',{
                method:"GET",
                headers:{
                    Accept: "application/json",
                    "Content-Type":"application/json"
                },
            })
            if(res.status === 200){
                dispatch({type:PSIGN_OUT})
                history.push('/')
            }
        }
        catch(e){
            console.log(e)
        }
    }
}

export const chkToken=()=>{
    return async(dispatch)=>{
        try{
            const res = await fetch('https://streamshow-backend.herokuapp.com/home',{
                method:"GET",
                headers:{
                    Accept: "application/json",
                    "Content-Type":"application/json"
                },

            })
            if(res.status === 400){
                await history.push('/login')
                const error = new Error("User Not logged in")
                throw error
            }
            const data = await res.json()
            dispatch({type:CHK_TKN, payload:data._id})
        }
        catch(e){
            alert(e)
            console.log(e)
        }
    }
}

export const createStream = (formValues) =>{
    return async (dispatch, getState) =>{
        const {userId} = getState().pauth
        const response = await server.post('/streams/new',{...formValues, userId})
        dispatch({type: CREATE_STREAM, payload: response.data})
    }
}

export const fetchStreams = () =>{
    return async (dispatch) =>{
        const response = await server.get('/streams')
        console.log(response.data)
        dispatch({type:FETCH_STREAMS, payload: response.data})
    }
}

export const fetchStream = (id) =>{
    return async(dispatch) =>{
        const response = await server.get(`/streams/${id}`)
        dispatch({type: FETCH_STREAM, payload: response.data})
    }
}

export const editStream = (id, formValues) =>{
    return async(dispatch)=>{
        const response = await server.patch(`/streams/edit/${id}`, {...formValues})
        dispatch({type:EDIT_STREAM, payload:response.data})
    }
}

export const deleteStream = (id)=>{
    return async(dispatch)=>{
        await server.delete(`/streams/delete/${id}`)
        dispatch({type: DELETE_STREAM, payload: id})
        history.push('/streams/list')
    }
}


export const sucSnack = (status) =>{
    return{
        type: SUC_SNACK,
        payload: status
    }
}
